import '../App.css';

import React, {Component} from 'react';


class TeamGenerator extends Component {
  constructor(props) {
    super();
    this.state = {blueTeam: [], redTeam: [], players: [], player: ''};
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleChange = this.handleChange.bind(this);
    this.deletePlayer = this.deletePlayer.bind(this);
    this.randomSplit = this.randomSplit.bind(this);
    this.winRateSplit = this.winRateSplit.bind(this);
  }

  handleChange(event) {
    this.setState({player: event.target.value});
  }
  handleSubmit(event) {
    event.preventDefault();
    var ps = this.state.players, d = {},
        summs = this.props.data['summoners']['sorted_summoners'],
        p = this.state.player;
    for (var i in summs) {
      if (summs[i].toLowerCase() == this.state.player.toLowerCase()) {
        p = summs[i]
      }
    }
    ps.indexOf(this.state.player) === -1 ? ps.push(p) :
                                           console.log('duplicate value');

    d['players'] = ps;
    d['player'] = '';
    this.setState(d)
  }

  deletePlayer(e) {
    var summ = e.target.value, newState = this.state.players;
    for (var i in newState) {
      if (newState[i] == summ) {
        newState.splice(i, 1);
      }
    }
    this.setState({'players': newState})
  }

  randomSplit(e) {
    console.log('Random');
    var ps = this.state.players, teams = {};
    for (var i = 0; i < 1000; i++) {
      this.shuffle(ps)
    }
    var half = Math.ceil(ps.length / 2);
    teams['blueTeam'] = ps.slice(0, half)
    teams['redTeam'] = ps.slice(half, ps.length);
    console.log(teams);
    this.setState(teams);
  }

  winRateSplit(e) {
    console.log('Split algorithm');
  }

  shuffle(array) {
    for (let i = array.length - 1; i > 0; i--) {
      let j = Math.floor(Math.random() * (i + 1));
      [array[i], array[j]] = [array[j], array[i]];
    }
  }
  render() {
    let d = this.props.data;
    console.log(this.state)
    if (typeof (d) == 'object') {
      d = d['summoners'];

      var playersCon = [];
      for (var i in this.state.players) {
        var winRate = '';
        if (d[this.state.players[i]]) {
          winRate = d[this.state.players[i]]['win rate']
        }
        playersCon.push(<div className = 'GplayerCont'>{parseInt(i) + 1}.) {
          this.state.players[i]
        } (Win rate: {winRate})<button onClick={this.deletePlayer} value={this.state.players[i]}className = 'GdeleteButton'>x</button></div>);
      }

      var bt = this.state.blueTeam, rt = this.state.redTeam, btContainer = [],
          rtContainer = [];

      for (var i in bt) {
        btContainer.push(
            <div className = 'GpickedTeam'>{bt[i]}<
                /div>)
      }
    }

    return (
        <div className = 'dataContainer'><div className = 'GformInput'>
        <form onSubmit = {this.handleSubmit}><label>Add Summoner<br>
        </br>
            <input type = 'summonerName' onChange = {this.handleChange} value =
             {
          this.state.player
             } />
        </label><br>
            </br><input type = 'submit' value = 'Add' />
            </form><div className = 'Gplayers'>{
            playersCon}</div>
            <div className = 'Gbuttons'>
            <button onClick = {this.randomSplit}>COMPLETELY RANDOM SPLIT<
                /button>
        <button onClick={this.winRateSplit}>WIN RATE SPLIT</button>
            </div>
        </div><div className = 'Gteam Gblue'>
            <div className = 'Gheader'>Blue Team</div>{btContainer}
            </div>
        <div className = 'Gteam'>
        <div className = 'Gheader'>Red Team</div>{rtContainer}
            </div></div>)
      }
    }

    export default TeamGenerator;
